import React from 'react';
import home from "../../../assets/home.png";

const Home = () => {
  return (
    <>
	<section className="home">
		<div className="container flex">
			<div className="left">
				<div className="img">
					<img src={home} alt="Home"/>
				</div>
			</div>
			.right.
		</div>
	</section>
	</>
  )
}

export default Home
